import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import { Home } from './pages/Home';
import { Day } from './pages/Day';
import { Member } from './pages/Member';

export const Routes = () => {
    return (
        <Router>
            <Switch>
                <Route path="/">
                    <Home />
                </Route>
                <Route path="/day">
                    <Day />
                </Route>                
                <Route path="/member">
                    <Member />    
                </Route>
                <Route>
                    <h1>404 - no er du heilt ute p√• LADE</h1>
                </Route>
            </Switch>
        </Router>
    );
}
